import React from 'react'

const img = "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQNwcTTew6SrG-BDisWgqwfpLKfg8Ro8m1bTQ&usqp=CAU";

function BookingCard(props) {
    const {name , carNumber , phone} = props;
  return (
    <div>
        <div>
            <img src={img} />
        </div>
        <div>
            Name : {name}
            Car Number : {carNumber}
            Phone : {phone} 
        </div>
    </div>
  )
}

export default BookingCard
